import axios from "axios";
import React, { useEffect, useState } from "react";
import { useMediaQuery } from "react-responsive";

const CaloriesOverview = ({date, profile}) => {
    const isTabletOrMobile = useMediaQuery({ query : '(max-width: 1224px' })

    const [burnedCalories, setBurnedCalories] = useState(1000)
    const [takenCalories, setTakenCalories] = useState(1500)
    const calorieDeficit = takenCalories - burnedCalories
    return(
        <div>
            {isTabletOrMobile ? (
                <div className="caloriesOverview__Container__Mobile">
                    <p>Verbrannte Kalorien: {burnedCalories}</p>
                    <p>Konsumierte Kalorien: {takenCalories}</p>
                    <p>Kaloriendefizit: {calorieDeficit}</p>
                </div>
            ) : (
                <div>
                    <p>Verbrannte Kalorien: {burnedCalories}</p>
                    <p>Konsumierte Kalorien: {takenCalories}</p>
                    <p>Kaloriendefizit: {calorieDeficit}</p>
                </div>
            )}
        </div>
    )
}

export default CaloriesOverview;
